import React from "react";

const Footer = () => {
	return (
		<div className="footerContainer">
			<div>
				<h1>developer to the stars</h1>
			</div>
			<div>
				<p>Twitter</p>
				<p>Github</p>
				<p>Contact</p>
			</div>
		</div>
	);
};

export default Footer;
